import React from 'react';
import classes from './Card.module.css'

const Card = (props) => {
	/*props.className 은 AddMembership.js 에 Card 속성에 className 과 동일해야함*/
	return <React.Fragment className={`${classes.card} ${props.className}`}>{props.children}</React.Fragment>

}
export default Card;
